import React from "react";
import ReactDom from "react-dom";
import "./index.css"; 
import OsumareLogo from "./OsumareLogo.png"

function Nav(){
    return(<>
    <div>
     <nav class="navbar bg-body-tertiary fixed-top position-absolute">
  <div class="container-fluid">
    <a class="navbar-brand"> <img
    src={OsumareLogo}
    /></a>
      <button class="btn btn-outline-success" type="submit">Search</button>
  </div>
</nav>
</div>
    </>);
}
export default Nav;
